import React, { Fragment, useState } from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import GetProductosAdministrador from './components/GetProductosAdministrador';
import CrearProducto from './components/CrearProducto';
import EditarProducto from './components/EditarProducto';
import Sidebar from './components/Sidebar';
import Producto from './components/Producto';
import Footer from './components/Footer';
import Header from './components/Header';

function App() {
  const [isOpen, setIsOpen] = useState(false);
  const [selectedProduct, setSelectedProduct] = useState(null);

  const toggle = (producto) => {
    setIsOpen(!isOpen);
    setSelectedProduct(producto);
  };

  return (
    <Fragment>
      <div className="App">
        <BrowserRouter>
          <Header />
          <Sidebar isOpen={isOpen} toggle={() => toggle(null)} selectedProduct={selectedProduct} />
          <Routes>
            <Route path="/" element={<Producto toggle={toggle} />} />
            <Route path="/productosAdmin" element={<GetProductosAdministrador />} />
            <Route path='/crearProducto' element={<CrearProducto />}></Route>
            <Route path='/editarProducto/:id' element={<EditarProducto />}></Route>
          </Routes>
          <Footer />
        </BrowserRouter>
      </div>
    </Fragment>


  );
}

export default App;
